import React, { useEffect } from "react";
import "../../normalize.scss";
import "../../base.scss";
import DadosUsuario from "../../components/Cadastro/DadosUsuario";
import View from "../view/view";
import { useSelector, useDispatch } from 'react-redux';
import {setUserImage} from "../../../store/actions/user.action"
import Selector from "../../helpers/selector";
import { useHistory } from "react-router-dom";

function DadosUser() {
  const history = useHistory();
  const dispatch = useDispatch()
  const user = useSelector(state => state.user.data); 
  const isLogged = Selector.isLogged(dispatch(setUser(user)));
  console.log(isLogged)
  console.log("User :: ", user);

  useEffect(() => {
    isLogged && history.push("/");
    // eslint-disable-next-line
  },[isLogged]);
  return (
    <View cadastro={true}>
      <DadosUsuario />
    </View>
  );
}

export default DadosUser;
